import { capitalizeFirstLetter } from "../../utils/utils";
const ProductDetail = (props) => {
    const keys = [];
    for (const key in props.product[0]) {
        keys.push(key)
    }
    return <div>
        {keys.map((item, i) => {
            return typeof (props.product[0][item]) === 'object' ?
                <li key={item}>{capitalizeFirstLetter(item)}: {props.product[0][item].map(el => <div>
                    {el}
                </div>)}</li>
                :
                <li key={item}>{capitalizeFirstLetter(item)}: {props.product[0][item]}</li>
        })}
    </div>
}

export default ProductDetail
